const Meal = function (props) {
  return (
    <div>
      {/* <h3>{props.children}</h3>
    <span>{props.children}</span>
    <span>{props.children}</span> */}
      <div className={styles.meal}>
        
        <h3 className="">Sushi</h3>
        <span>Finest fish and veggies</span>
        <span>$22.99</span>
      </div>

      <div>
        <span>Amount</span>

        <input type="number" min="1" max="5" step="1" defaultValue="1" />
        <button>+ Add</button>
      </div>
    </div>
  );
};

export default Meal;
